# >>### (5) 셀레늄 이용한 이미지 수집

# In[21]:


## 스크롤 자동으로 내리다가 더보기 버튼 나오면 클릭 하도록 하기
print(f"{query} 스크롤 내리는 중...")
elem = driver.fine_element_by_tag_name('body')
for i in range(60):
    elem.send_keys(Keys.Page_DOWN)
    time.sleep(0.1)
    
try:
    driver.fine_element_by_xpath("/html/body/div[1]/div[3]/form/div[1]/div[1]/div[1]/div/div[2]/textarea")
    for i in range(60):
        elem.send_keys(Keys.PAGE_DOWN)
        time.sleep(0.1)
        
except:
    pass


# In[ ]:


## 이미지 개수 파악하기
links = []
images = driver.find_elements_by_css_selector("img.rg_i.Q4LuWd")
for image in images:
    
    if image.get_attribute('src') != None:
        links.append(image.get_attribute('src'))
    elif image.get_attribute('data-src') != None:
        links.append(image.get_attribute('data=src'))
    elif image.get_attribute('data-iurl') != None:
        links.append(image.get_attribute('data=iurl'))


# In[22]:


### 이미지 다운로드 
count = 0
for i in links : 
    start = time.time()
    url = i
    os.makedirs(f"./{query}_img_download/", exist_ok=True)
    while True:
        try:
            urllib.request.urlretrieve(url, f"./{query}_imag_download/{str(count)}_{query}.png")
            print(f"{str(count+1)} / {str/len(links)} / {query} / 다운로드시간 : {str(time.time() - start)[:5]}초")
            break
        except urllib.error.HTTPError as e:
            print(f"HTTPError 발생 ({e}): 재시도중...")
            time.sleep(5)
        except urllib.error.HTTPError as e:
            print(f"Error 발생 ({e}): 재시도중...")
            time.sleep(5)            
        if time.time() - start > 60:
            print(f"{query} 이미지 다운로드 실패")
            break
    count = count + 1
    
print(f"{query} 이미지 다운로드 완료")
driver.close()


